    render() {
        return (
            <div>
                <button 
                style={{backgroundColor:
                    this.props.id > 0 && this.props.pw ? "#0095F6" : "#B2DFFC"
                }} 
                type="button" 
                className="loginButton">로그인</button>
            </div>
        )
    }
}

export default Btn;
